import React, { useRef, useEffect, useState } from "react";
import "../styles/LuxurySlider.css";

const SAMPLE_CARS = [
  {
    id: "c1",
    title: "2018 Jeep Compass",
    subtitle: "Sport 1.4 Petrol",
    price: "₹7.50 Lakh",
    emi: "EMI ₹12,772/m*",
    image: process.env.PUBLIC_URL + "/jeep.png",
  },
  {
    id: "c2",
    title: "2019 Mercedes C-Class",
    subtitle: "C 200",
    price: "₹14.20 Lakh",
    emi: "EMI ₹24,000/m*",
    image: process.env.PUBLIC_URL + "/merc.png",
  },
  {
    id: "c3",
    title: "2020 Audi A3",
    subtitle: "Premium Plus",
    price: "₹10.30 Lakh",
    emi: "EMI ₹17,500/m*",
    image: process.env.PUBLIC_URL + "/audi.png",
  },
];

export default function LuxurySlider({ cars = SAMPLE_CARS }) {
  const viewportRef = useRef(null);
  const cardRef = useRef(null);
  const [cardWidth, setCardWidth] = useState(300);

  useEffect(() => {
    // compute card width from CSS variable if available, otherwise measurement
    const compute = () => {
      // try reading computed var --card-w first
      const root = getComputedStyle(document.documentElement).getPropertyValue("--card-w");
      if (root) {
        // strip px and fallback if not a px value
        const px = parseFloat(root);
        if (!Number.isNaN(px)) {
          setCardWidth(px);
          return;
        }
      }

      // fallback: measure the first card (deferred to allow layout)
      const card = cardRef.current;
      if (card) setCardWidth(card.offsetWidth + parseFloat(getComputedStyle(card).marginRight || 12));
    };

    compute();
    window.addEventListener("resize", compute);
    return () => window.removeEventListener("resize", compute);
  }, []);

  // scroll by one card
  const scrollBy = (dir = 1) => {
    const el = viewportRef.current;
    if (!el) return;
    el.scrollBy({ left: dir * cardWidth, behavior: "smooth" });
  };

  // optional: when tab / data changes you might want to scroll to start
  // const setCars = ... // if dynamic

  return (
    <section className="lux-section" aria-label="Luxury slider">
      <div className="lux-inner">
        <div className="lux-header">
          <div className="lux-brand">MAX</div>
          <div className="lux-sub">23+ similar luxury cars</div>
        </div>

        <div className="lux-carousel-shell">
          <button
            className="lux-nav lux-prev"
            aria-label="Previous"
            onClick={() => scrollBy(-1)}
          >
            ‹
          </button>

          <div className="lux-list-viewport" ref={viewportRef}>
            <div className="lux-list">
              {cars.map((c, idx) => (
                <article
                  key={c.id}
                  className="lux-card"
                  ref={idx === 0 ? cardRef : null}
                  aria-label={c.title}
                >
                  <div className="lux-card-image" style={{ backgroundImage: `url(${c.image})` }} />
                  <div className="lux-card-body">
                    <div className="lux-card-row">
                      <div className="lux-card-title">{c.title}</div>
                      <div className="lux-card-price">{c.price}</div>
                    </div>
                    <div className="lux-card-sub">{c.subtitle}</div>
                    <div className="lux-card-emi">{c.emi}</div>
                  </div>
                </article>
              ))}

              {/* LAST tile - view more */}
              <article className="lux-card lux-card-more" aria-hidden="false">
                <div className="lux-more-overlay">
                  <div className="lux-more-inner">
                    <div className="lux-more-text">View more luxury cars</div>
                  </div>
                </div>
              </article>
            </div>
          </div>

          <button
            className="lux-nav lux-next"
            aria-label="Next"
            onClick={() => scrollBy(1)}
          >
            ›
          </button>
        </div>

        <div className="lux-action">
          <button className="lux-explore">Explore</button>
        </div>
      </div>
    </section>
  );
}
